      <text>We+divided+the+whole+case+design+into+two+parts%2C+cover+and+the+base+case.+The+framework+had+been+presented+via+CREO+E+and+Solid+Works.%0D%0AThe+outer+case+is+designed+as+trapezoidal+shape+aiming+to+save+the+space+considering+the+shape+of+MCU+board+combination.+Besides%2C+the+middle+parts+providing+efficient+support+so+to+prevent+the+radial+movement+in+the+case.+This+design+also+divide+the+equipment+into+two+separate+space+so+that+MCU+board+and+sensor+will+not+influence+each+other.+When+it+comes+to+the+material%2C+PVC+is+a+economical+and+practical+choice+for+it+is+easy+to+process%2C+cheap+and+strong+enough.</text>

      <text>1.How+to+apply+the+MCU+board.%0D%0AThe+support+design+for+MCU+board+is+a+fixed+area+similar+to+the+card+slot%2C+customers+can+choose+to+insert+it+like+a+card+or+directly+press+the+board+into+case+(Small+slope+may+be+added+if+the+latter+design+is+preferred)%0D%0A2.How+to+apply+the+sensors%0D%0ASensors+are+placed+on+the+bottom+of+base+board.+Sensing+area+faces+the+ground+while+the+line+interface+towards+MCU+board(the+black+cubes+in+slides).+The+sensor+boards+are+embedded+in+a+pre-designed+slot.+An+isolated+area+is+designed+in+the+middle+of+the+bottom+to+prevent+the+two+sensors+from+contacting+each+other.</text>
